import { React } from "react";
import { BaseUrl, authHeader } from "./common/common";

async function LoanList(email, role) {
    console.log(role,"dad",email)
  const requestOptions = {
    method: "GET",
    headers: {
      "Content-Type": "application/json",
      authorization: authHeader().Authorization,
    },
  };
  const GetResponse = await fetch( BaseUrl + "api/loans/all" + "?email=" + email + "&role=" + role, requestOptions)
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      return data;
    });
  return GetResponse;
}

async function changestatus(status, Id) {
  const requestOptions = {
    method: "GET",
    headers: {
      "Content-Type": "application/json",
      authorization: authHeader().Authorization,
    },
  };
  const GetResponse = await fetch( BaseUrl + "api/loans/changeStatus" + "?status=" + status + "&Id=" + Id, requestOptions)
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      return data;
    });
  return GetResponse;
}

async function registerUser(status, Id) {
    const requestOptions = {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
        authorization: authHeader().Authorization,
      },
    };
    const GetResponse = await fetch( BaseUrl + "api/register" + "?status=" + status + "&Id=" + Id, requestOptions)
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        return data;
      });
    return GetResponse;
  }


export { LoanList, changestatus, registerUser};
